import{_ as e,o,c as a,b as t}from"./app-de7a4551.js";const r={},n=t('<h1 id="programming-language" tabindex="-1"><a class="header-anchor" href="#programming-language" aria-hidden="true">#</a> Programming Language</h1><p>Programming language is <em>a type of</em> <code>human-to-computer</code> communication that allows us to create computer programs. It is <em>a set of</em> instructions written in a specific format that the computer can understand and execute. Programming languages <em>are used to</em> write software for various purposes such as creating websites, developing mobile apps, and designing video games.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 编程语言是一种人类与计算机之间的沟通方式，使我们能够创建计算机程序。它是一套以特定格式编写的指令，计算机可以理解并执行。编程语言被用来编写用于各种目的的软件，如创建网站、开发移动应用和设计视频游戏等。</p><p><strong>phrase:</strong><br> a type of -&gt; 一种/一种类型的；一种型号的；一类<br> a set of -&gt; 一套；一副/ 一组；一系列；一整套<br> are used to -&gt; 被用来；被用来做<br> human-to-computer -&gt; 人机对话</p></details><p>There are many programming languages <code>available</code> today, each with its own <code>unique</code> features and <code>capabilities</code>. Some popular programming languages include C, C++, Java, Python, JavaScript, and Ruby. These languages are designed to be easy to learn and use, making them <code>accessible</code> to people of all ages and skill levels.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 现在有许多编程语言可用，每一种都有自己独特的特性和能力。一些流行的编程语言包括 C、 C + + 、 Java、 Python、 JavaScript 和 Ruby。这些语言的设计是为了易于学习和使用，使它们对所有年龄和技能水平的人来说都是易于理解的。</p><p><strong>words:</strong><br> available<br><code>英 [əˈveɪləb(ə)l]美 [əˈveɪləb(ə)l]</code></p><blockquote><p>adj. 可用的，可获得的；有空的，有闲暇的；未婚的，单身的</p></blockquote><p>unique<br><code>英 [juˈniːk]美 [juˈniːk]</code></p><blockquote><p>adj. 独一无二的，独特的；非常特别的，极不寻常的；（某人、地或事物）独具的，特有的<br> n. &lt;古&gt;独一无二的人（或事）</p></blockquote><p>capability [ 复数 capabilities ]<br><code>英 [ˌkeɪpəˈbɪləti]美 [ˌkeɪpəˈbɪləti]</code></p><blockquote><p>n. 能力，才能；（国家的）军事力量；计算机性能</p></blockquote><p>accessible<br><code>英 [əkˈsesəb(ə)l]美 [əkˈsesəb(ə)l]</code></p><blockquote><p>adj. 可到达的，可进入的；易得到的，可使用的；可以理解的，易懂的；平易近人的，随和的；易受影响的</p></blockquote></details><p>Learning a programming language requires a basic understanding of <code>logic</code> and problem-solving skills. Once you have <code>mastered</code> a programming language, you can create your own software applications or contribute to open-source projects. With the growing <code>demand</code> for technology in today&#39;s world, programming has become an essential skill for anyone <em>looking to</em> <code>pursue</code> a career in technology or related fields.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 学习一门编程语言需要基本的逻辑知识和解决问题的能力。一旦你掌握了一门编程语言，你就可以创建自己的软件应用程序或者为开源项目做贡献。随着当今世界对技术的需求日益增长，编程已经成为任何想在技术或相关领域寻求职业生涯的人必备的技能。</p><p><strong>phrase:</strong><br> looking to -&gt; 寻求，期待：指望某人或某事来提供帮助、支持或解决问题。</p><p><strong>words:</strong></p><p>logic<br><code>英 [ˈlɒdʒɪk]美 [ˈlɑːdʒɪk]</code></p><blockquote><p>n. 逻辑，（做某事的）道理；推理方法，逻辑学；（事实或事件的）规律，相互联系；（计算机或电器的）逻辑操作</p></blockquote><p>master ( mastering, mastered, masters )<br><code>英: [ˈmɑːstə(r)] 美: [ˈmæstər]</code></p><blockquote><p>n. 硕士；主人；主宰；能手<br> v. 掌握；精通；控制（情绪）；控制（动物或人）<br> adj. 灵巧的；最大的；最重要的</p></blockquote><p>demand ( demanding, demanded, demands )<br><code>英 [dɪˈmɑːnd]美 [dɪˈmænd]</code></p><blockquote><p>v. 强烈要求；需要，需求<br> n. 坚决的要求；需求，需求量；（困难的）要求</p></blockquote><p>pursue ( pursuing, pursued, pursues )<br><code>英 [pəˈsjuː]美 [pərˈsuː]</code></p><blockquote><p>v. 追求，致力于，执行；继续探讨（或追究、从事）；追逐，跟踪，追赶；沿着……前行；追求（某人）；力劝（某人）接受聘用</p></blockquote></details><p>In conclusion, programming language is a powerful tool that enables us to create complex software applications that can make our lives easier and more efficient. <code>Whether</code> you are a beginner or an experienced programmer, learning a new programming language can be a rewarding experience that <em>opens up</em> new <code>opportunities</code> and <code>possibilities</code>.</p><details class="custom-container details"><summary>translation</summary><p><strong>sentence:</strong><br> 总而言之，编程语言是一种强大的工具，使我们能够创建复杂的软件应用程序，可以使我们的生活更加轻松和高效。无论您是初学者还是经验丰富的程序员，学习一门新的编程语言可以是一次有益的经历，它将为你带来新的机会和可能性。</p><p><strong>phrase:</strong><br> open up -&gt; (打)开；割开；开发(资源)；揭示</p><p><strong>words:</strong><br> whether<br><code>英: [ˈweðə(r)] 美: [ˈhweðər]</code></p><blockquote><p>conj. （表示迟疑或两个可能性之间的选择）是否<br> n. 可能的选择<br> pron. 〈古〉(在…之中)哪一个</p></blockquote><p>opportunity [ 复数 opportunities ]<br><code>英 [ˌɒpəˈtjuːnəti]美 [ˌɑːpərˈtuːnəti]</code></p><blockquote><p>n. 时机，机会</p></blockquote><p>possibility<br><code>英 [ˌpɒsəˈbɪləti]美 [ˌpɑːsəˈbɪləti]</code></p><blockquote><p>n. 可能，可能性；可能的选项，可能的途径；发展前景，潜能；可能发生的事；机会，契机</p></blockquote></details>',9),s=[n];function c(p,i){return o(),a("div",null,s)}const d=e(r,[["render",c],["__file","18-programming-language.html.vue"]]);export{d as default};
